# OEIS sequence: A137110

def auptod(maxdigits, only="2567"):
  aset, digset, valid = set(), set(only), set(only)
  for e in range(1, maxdigits+1):
    newvalid = set()
    for tstr in valid:
      t = int(tstr)
      if set(str(t**2)) <= digset: aset.add(t)
      for d in digset:
        dtstr = d + tstr
        dt = int(dtstr)
        remstr = str(dt**2)[-e-1:]
        if set(remstr) <= digset: newvalid.add(dtstr)
    valid = newvalid
  return sorted(aset)
